//SPDX-License-Identifier:MIT

pragma solidity ^0.8.0;

contract Poly{
int balance=100;
function add(int _a, int _b) public pure returns(int){
    return _a+_b;
}
function add(int _a) public view returns(int){
    return _a+balance;
}
}

